      a(
        "evaluations.MFicheCalculNote",
        '{"titre":"Comment est calculée la note d\'une évaluation ?","html":{"_T":23,"V":"<p><span style=\\"color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\\"><span style=\\"font-family: arial,helvetica,sans-serif; font-size: 13px;\\">Pour calculer la note :</span></span></p><ol><li><span style=\\"color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\\"><span style=\\"font-family: arial,helvetica,sans-serif; font-size: 13px;\\"><span>On fait la somme des points obtenus &agrave; chaque item (en prenant en compte son coefficient et les points attribu&eacute;s dans </span><span style=\\"color: #888888;\\"><strong>Param&egrave;tres &gt; Niveaux de ma&icirc;trise)</strong></span></span></span></li><li><span style=\\"color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\\"><span style=\\"font-family: arial,helvetica,sans-serif; font-size: 13px;\\">Cette somme est divis&eacute;e <span style=\\"color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\\"><span style=\\"font-family: arial,helvetica,sans-serif; font-size: 13px;\\">par le nombre d\'items &eacute;valu&eacute;s. </span></span></span></span></li><li><span style=\\"color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\\"><span style=\\"font-family: arial,helvetica,sans-serif; font-size: 13px;\\"><span style=\\"color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\\"><span style=\\"font-family: arial,helvetica,sans-serif; font-size: 13px;\\"><span style=\\"color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\\"><span style=\\"font-family: arial,helvetica,sans-serif; font-size: 13px;\\"><span style=\\"color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial,helvetica,sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\\"><span style=\\"font-family: arial,helvetica,sans-serif; font-size: 13px;\\">Le r&eacute;sultat est ramen&eacute; sur 20 (ou sur le bar&egrave;me du devoir) puis arrondi au point sup&eacute;rieur</span></span></span></span></span></span></span></span></li></ol><p>&nbsp;<span style=\\"font-size: 11px;\\"><em>Exemple avec les couleurs et valeurs par d&eacute;faut :</em></span></p><ul><li><span style=\\"font-size: 11px;\\"><em><img src=\\"data:image/png;base64,\\" alt=\\"\\" />&nbsp;: 50 points</em></span></li><li><span style=\\"font-size: 11px;\\"><em><img src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAdUlEQVQYlZXQsQmAQAwF0FvO0gPLOEfazGLlDkKu9uS7gRuYJbQ4UThRz0+KFI8kxG0FcWcXDQzxSl6JIZPNOeqWvhqarLqlv9Bk812kioYDMeQJMeRAPrRPyIe2ACn9WRcN34cXvSBlXMGQWqlWYkiakaOX7D6kKu7V4gTLAAAAAElFTkSuQmCC\\" alt=\\"\\" />&nbsp;: 40 points</em></span></li><li><span style=\\"font-size: 11px;\\"><em><img src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAZUlEQVQYlZXQMQ7AIAgFULuLh+JcXqp6m4aN1ZH9d7CmTa0JJQwML0B+gKPCPVqBMoQgBGVYnVDLOLZ3t/xAVj9EbysDKS+R8kCSlkiSB9Gvc1Ycj7siuMLcoQyJkAjlvmNC6zoBm69Vps8BQyUAAAAASUVORK5CYII=\\" alt=\\"\\" />&nbsp;: 25 points</em></span></li><li><span style=\\"font-size: 11px;\\"><em><img src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAA0AAAAMCAIAAAA21aCOAAAAZ0lEQVQYlZXQMQ6AMAgFUOfu5Uz/WByqcDZCQ3TQtLFaUwkDwwuEv+1rtbUpRBwwIiNyIFRfXGW2lIauzDcXqk90doh058DMOdCdEc2cEf13q3dDZOmP1VyunEtxwHK2nB1om0b3XQdrUzqm5Ss4FwAAAABJRU5ErkJggg==\\" alt=\\"\\" />&nbsp;: 10 points</em></span></li></ul><p><span style=\\"font-size: 11px;\\"><em>Avec les niveaux de ma&icirc;trise suivants (affect&eacute;s du coefficient 1) :&nbsp;<img src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAdUlEQVQYlZXQsQmAQAwF0FvO0gPLOEfazGLlDkKu9uS7gRuYJbQ4UThRz0+KFI8kxG0FcWcXDQzxSl6JIZPNOeqWvhqarLqlv9Bk812kioYDMeQJMeRAPrRPyIe2ACn9WRcN34cXvSBlXMGQWqlWYkiakaOX7D6kKu7V4gTLAAAAAElFTkSuQmCC\\" alt=\\"\\" />&nbsp;<img src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAdUlEQVQYlZXQsQmAQAwF0FvO0gPLOEfazGLlDkKu9uS7gRuYJbQ4UThRz0+KFI8kxG0FcWcXDQzxSl6JIZPNOeqWvhqarLqlv9Bk812kioYDMeQJMeRAPrRPyIe2ACn9WRcN34cXvSBlXMGQWqlWYkiakaOX7D6kKu7V4gTLAAAAAElFTkSuQmCC\\" alt=\\"\\" />&nbsp;<img src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAA0AAAAMCAIAAAA21aCOAAAAZ0lEQVQYlZXQMQ6AMAgFUOfu5Uz/WByqcDZCQ3TQtLFaUwkDwwuEv+1rtbUpRBwwIiNyIFRfXGW2lIauzDcXqk90doh058DMOdCdEc2cEf13q3dDZOmP1VyunEtxwHK2nB1om0b3XQdrUzqm5Ss4FwAAAABJRU5ErkJggg==\\" alt=\\"\\" />&nbsp;un &eacute;l&egrave;ve obtiendra la note de 12/20&nbsp;</em></span><em><span style=\\"font-size: 11px;\\">&nbsp;car il a obtenu&nbsp;90 points sur les 150 possibles.&nbsp;</span></em></p><p><span style=\\"font-family: arial,helvetica,sans-serif; font-size: 13px;\\">&nbsp;</span></p>"},"width":500,"height":275,"type":4,"boutons":{"_T":18,"V":1024}}'
      );
