      a(
        "ficheScolaire.MFicheValidationCompetencesLSL",
        '{"titre":"Comment sont calculés les niveaux de compétences du livret ?","html":{"_T":23,"V":"<p><span style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\\">Ce calcul prend en compte toutes les &eacute;valuations associ&eacute;es aux services mis en correspondance avec les mati&egrave;res du livret sauf celles qui ont un coefficient nul.</span></p><p><span style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\\">L\'&eacute;chelle de valeurs utilis&eacute;e pour le calcul est d&eacute;finie dans <span style=\\"color: #888888;\\"><strong><em>Param&egrave;tres &gt; &Eacute;valuation &gt; Niveaux de ma&icirc;trise</em></strong></span>.</span>&nbsp;<em>(Illustration avec les couleurs par d&eacute;faut)&nbsp;</em></p><ol><li><span style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\">Le r&eacute;sultat obtenu &agrave; chaque &eacute;valuation prise en compte est transform&eacute; en points&nbsp;</span><br /><span style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\">avec les valeurs par d&eacute;faut&nbsp;&nbsp;<img style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\" src=\\"data:image/png;base64,\\" alt=\\"\\" />&nbsp;= 50 points |&nbsp;<img style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\" src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAdUlEQVQYlZXQsQmAQAwF0FvO0gPLOEfazGLlDkKu9uS7gRuYJbQ4UThRz0+KFI8kxG0FcWcXDQzxSl6JIZPNOeqWvhqarLqlv9Bk812kioYDMeQJMeRAPrRPyIe2ACn9WRcN34cXvSBlXMGQWqlWYkiakaOX7D6kKu7V4gTLAAAAAElFTkSuQmCC\\" alt=\\"\\" /> = 40 points |&nbsp;<img style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\" src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAZUlEQVQYlZXQMQ7AIAgFULuLh+JcXqp6m4aN1ZH9d7CmTa0JJQwML0B+gKPCPVqBMoQgBGVYnVDLOLZ3t/xAVj9EbysDKS+R8kCSlkiSB9Gvc1Ycj7siuMLcoQyJkAjlvmNC6zoBm69Vps8BQyUAAAAASUVORK5CYII=\\" alt=\\"\\" /> = 25 points |&nbsp;<img style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\" src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAA0AAAAMCAIAAAA21aCOAAAAZ0lEQVQYlZXQMQ6AMAgFUOfu5Uz/WByqcDZCQ3TQtLFaUwkDwwuEv+1rtbUpRBwwIiNyIFRfXGW2lIauzDcXqk90doh058DMOdCdEc2cEf13q3dDZOmP1VyunEtxwHK2nB1om0b3XQdrUzqm5Ss4FwAAAABJRU5ErkJggg==\\" alt=\\"\\" /> = 10 points<br />Quand les niveaux interm&eacute;diaires sont utilis&eacute;s&nbsp;<img style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\" src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAcklEQVQYlZXQLQ6AMAwF4N0EzU7UO3EWRC2b6h1mYerNzVWDGD/JCDCaioovbfPM2lDmnKBOQBwtRyugpL5GIQ/j3FUd8nChpP4uSkPdjgT0hAS0I472CXG0f1DTOaj7frwpgiPMSUC89Lz0Aio7avRSG8YxRv/F+sIoAAAAAElFTkSuQmCC\\" alt=\\"\\" />&nbsp;= 33 points et&nbsp;<img style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\" src=\\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAwAAAAMCAIAAADZF8uwAAAAaElEQVQYlZXQwQ3AIAgFUDfoWV2Jrbz0ImMwQjk7h+7ye7CmTa0JJRw4vAD5DoZy91gVQuAADhBC0wmVhH17d0kP1PRD9K46kNASCQ3EcYk4WlD4da5aHjdFcIV5QAjZI3sI9R0TWtcJl3BA5JUq0ykAAAAASUVORK5CYII=\\" alt=\\"\\" /> = 18 points.<br /><br /></span></li><li><span style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\">On obtient ainsi un nombre de points par mati&egrave;re&nbsp;pour chaque &eacute;l&egrave;ve.<br /><br /></span></li><li><span style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\">On divise ce nombre de points par le nombre d\'&eacute;valuations pour obtenir un niveau de comp&eacute;tence entre 1 et 4 :<br />- plus de 45 points :&nbsp; &nbsp; &nbsp; &nbsp; <strong>4</strong></span><br /><span style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\">- entre 33 et 45 &nbsp;points : <strong>3</strong></span><br /><span style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\">- entre 18 et&nbsp; 33 points : <strong>2</strong></span><br /><span style=\\"font-family: arial, helvetica, sans-serif; font-size: 12px;\\">- moins de 18 points :&nbsp; &nbsp; <strong>1</strong></span></li></ol>"},"width":565,"height":340,"type":4,"boutons":{"_T":18,"V":1024}}'
      );
